import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const importAll = require =>
  require.keys().reduce((acc, next) => {
    acc[next.replace("./", "")] = require(next);
    return acc;
  }, {});



ReactDOM.render(
  <App />,
  document.getElementById('app')
);
